Zoe is a young student. At 19, she has not yet experienced the thrill of a sexual relationship with a boy, but things could change during the weekend she will spend at the country house that belongs to the handsome Michael. However, there is a problem: Zoe's mother, a hot 40-something woman with an insatiable sexual appetite, has also decided to seduce Michael. Things look complicated for this weekend in the country, especially as adulterous work colleagues and swinger neighbours are also invited. Will Zoe, the pretty virgin, manage to seduce Michael by being even more of a bitch than her own mother? Whatever happens, it's the sexual goal she has set herself... 

Cast: Angel Wicky, Barra Brass, Satin Bloom, Vanda Lust, David Perry, Mike Angelo, Choky Ice, George Uhl, Cage, Lilith Lee
Year: 2014
